import React from 'react';
import NewsFeed from '../News/NewsFeed'; // импорт компонента, отвечающего за отображение отдельной новости
import classes from 'News.module.css'
const News = ({news}) => {

    return (
        <div className={classes.allPosts}>
            <NewsFeed news={news}/>
        </div>
    );
};

export default News;
